ة إنشاء صفحة ويب بإستخدام أكواد HTML\n\n\n________________\n\nعملت تحدي html جميل جداً تقدروا تختبروا مستواكم فيه\nالتحدي مكون من 35 سؤال هنا\n\nhttps://nouvil.net/problem-solving/html-quiz/\n\n\n\n\n\nالجروب الخاص بنا\nhttps://www.facebook.com/groups/1810581845642171\n\nتحميل محرر الاكواد visual  studio لاجهزة الكومبيوتر\nhttps://code.visualstudio.com/\n\nتحميل تطبيق محرر الاكواد للهواتف الاندرويد\nhttps://play.google.com/store/apps/details?id=com.ansm.anwriter\n\n_______________\nكورس css في فيديو واحد هنا\nhttps://youtu.be/Z-5QVutAEW4\n\nماهي لغة الترميز HTML؟\nالحروف هي إختصار HyperText Markup Language، وهي ليست لغة برمجية بالمعنى المتعارف عليه للغات البرمجة، ولكنها لغة أو طريقة لوصف محتويات صفحة الويب لبرامج التصفح، حيث أن أي برنامج متصفح انترنت يحتاج لمعرفة محتويات الصفحة من عناوين ونصوص وصور وروابط و غير ذلك من مكونات صفحة الويب، حتى تتمكن من عرضها بالشكل الصحيح، ولغة الترميز HTML، هي اللغة الرئيسية التي يتكون منها أي موقع أو صفحة على شبكة الإنترنت.\n\nوتتكون صفحة الويب من مجموعة من العناصر (Tags) أو تعرف كــ الوسوم، يكتب كل وسم بين (angle brackets) أو كما تسمى علامة أصغر من  وعلامة أكبر  ولا يقوم المتصفح بعرض هذه الوسوم، ولكن يقوم بعرض محتوياتها، وهناك نوعين من الوسوم.\n\nما هي أنواع الوسوم Tags؟\nالنوع الأول: وهو عبارة عن وسم يتم عرض محتواه مباشرة في صفحة الويب، مثال img و input \n\nالنوع الثاgي: وهو عبارة عن وسم يصف ما بداخله من نصوص ، وقد يحتوي هذا الوسم بداخله على وسم آخر كعنصر   وسوف تلاحظ في هذا النوع أن كل وسم يتكون من جزئين (وسم البداية) و (وسم النهاية) وبينهما المحتوى الذي يتم عرضه في المتصفح.\n\nكيفية إنشاء صفحة ويب\nنبدأ أولا بفتح برنامج notepad ثم من خلال القائمة File نقوم بحفظ الملف عن طريق إختيار الأمر Save As، وبعد ذلك سوف تظهر نافذة نكتب في خانة (إسم الملف - File Name) أي إسم من إختيارك فليكن مثلا test.html ويجب كتابة إسم الملف مع إمتداد الملف ولكتابة أكواد HTML يجب أن يكون إمتداد الملف إما (.html أو .htm) و في النافذة من الخانة Save as type سوف نختار All Files وفي خانة (Encoding) سوف نختار UTF-8 وذلك لكي يدعم الملف كتابة اللغة العربية ثم نضغط Save، والشكل التالي يوضح الخطوات بالتفصيل.\nبعد إنشاء الملف ومعرفة المكونات الأساسية لعنصر من عناصر لغة الـ HTML سوف نبدأ بكتابة الأكواد الأساسية لإنشاء صفحة ويب (أو يمكنك نسخ محتويات المربع التالي في الملف) وبعدها سوف أشرح كل عنصر بالتفصيل.\n ووظيفته أن يصف للمتصفح أن الكود المستخدم هو بلغة HTML، أما الوصف lang فوظيفته أن يصف للمتصفح أن محتويات صفحة الويب سوف تكون باللغة العربية، وذلك لأننا إخترنا القيمة ar أما إذا كان المحتوى باللغة الإنجليزية فيمكن أن تكون قيمة الوصف en. وقمنا بوضع وسم البداية (Opening Tag) في أول الأكواد وفي نهاية الكود كتبنا وسم النهاية (Closing Tag)، وبعد ذلك سوف نقسم الصفحة إلى قسمين رئيسيين أولهما  ومحتوى هذا الوسم لا يظهر في المتصفح، ولكنه يحتوي على معلومات عن الصفحة وعن كيفية عرض محتويات الصفحة وذلك بإستخدام العناصر وثاني قسم في صفحة الويب وكل ما يكتب بداخل هذا الوسم هو ما يتم عرضه وتنسيقه من خلال المتصفح\n\nما هي لغة ترميز النص الفائق؟\nلغة ترميز النص الفائق هي ليست لغة برمجيّة بل لغة وصفيّة (markup language) تعمل على وصف هيكلة محتويات صفحات الويب. تتألف لغة ترميز النص الفائق من مجموعة من العناصر (elements) تُستخدَم لاحتواء الأجزاء المختلفة من المحتوى لتجعله يظهر بطريقة معينة. فيمكن استخدام الوسوم المغلقة (enclosing tage)، مثلاً، لإضافة رابط تشعبي لكلمة أو لصورة يشير لموقع آخر، كما يمكن استخدامها لجعل الكلام مائل أو لتصغير الخط وتكبيره. لنأخذ  النص التالي كمثال:\nماذا ستتعلم في كورس تصميم مواقع الويب و كورس html\nمقدمة عن تصميم المواقع الالكترونية وأنواع المواقع وطرق تصميم المواقع\nالتعريف ببرامج تصميم المواقع المختلفة و مميزات كل منها\n التعريف بلغة HTML المستخدمة في تصميم المواقع \nشرحة بنية ومحتويات ملف HTML\nشرح tags and containers\nشرح انواع content models in HTML5\nأساسيات HTML\nشرح المسافات الفارغة والتعليفات في الكود\nالنصوص والفقرات\nتنسيق الملف\nاضافة صور الى موقعك\nاضافة فيديوهات الى موقعك\nاضافة صوتيات الى موقعك\nاستخدام block and inline tags\nDisplaying characters with references\nMetadata and the Document Head\nاضافة الاسكربتات للملف\nاستخدام الميتا تاج Meta Tag\nطريقة تهيئة الصفحة لمحركات البحث\nالنصوص\nHTML5\nاستخدام الج ا لغة أو طريقة لوصف محتويات صفحة الويب لبرامج التصفح، حيث أن أي برنامج متصفح انترنت يحتاج لمعرفة محتويات الصفحة من عناوين ونصوص وصور وروابط و غير ذلك من مكونات صفحة الويب، حتى تتمكن من عرضها بالشكل الصحيح، ولغة الترميز HTML، هي اللغة الرئيسية التي يتكون منها أي موقع أو صفحة على شبكة الإنترنت.\n\nوتتكون صفحة الويب من مجموعة من العناصر (Tags) أو تعرف كــ الوسوم، يكتب كل وسم بين (angle brackets) أو كما تسمى علامة أصغر من  وعلامة أكبر  ولا يقوم المتصفح بعرض هذه الوسوم، ولكن يقوم بعرض محتوياتها، وهناك نوعين من الوسوم.\n\nما هي أنواع الوسوم Tags؟\nالنوع الأول: وهو عبارة عن وسم يتم عرض محتواه مباشرة في صفحة الويب، مثال img و input \n\nالنوع الثاgي: وهو عبارة عن وسم يصف ما بداخله من نصوص ، وقد يحتوي هذا الوسم بداخله على وسم آخر كعنصر   وسوف تلاحظ في هذا النوع أن كل وسم يتكون من جزئين (وسم البداية) و (وسم النهاية) وبينهما المحتوى الذي يتم عرضه في المتصفح.\n\nكيفية إنشاء صفحة ويب\nنبدأ أولا بفتح برنامج notepad ثم من خلال القائمة File نقوم بحفظ الملف عن طريق إختيار الأمر Save As، وبعد ذلك سوف تظهر نافذة نكتب في خانة (إسم الملف - File Name) أي إسم من إختيارك فليكن مثلا test.html ويجب كتابة إسم الملف مع إمتداد الملف ولكتابة أكواد HTML يجب أن يكون إمتداد الملف إما (.html أو .htm) و في النافذة من الخانة Save as type سوف نختار All Files وفي خانة (Encoding) سوف نختار UTF-8 وذلك لكي يدعم الملف كتابة اللغة العربية ثم نضغط Save، والشكل التالي يوضح الخطوات بالتفصيل.\nبعد إنشاء الملف ومعرفة المكونات الأساسية لعنصر من عناصر لغة الـ HTML سوف نبدأ بكتابة الأكواد الأساسية لإنشاء صفحة ويب (أو يمكنك نسخ محتويات المربع التالي في الملف) وبعدها سوف أشرح كل عنصر بالتفصيل.\n ووظيفته أن يصف للمتصفح أن الكود المستخدم هو بلغة HTML، أما الوصف lang فوظيفته أن يصف للمتصفح أن محتويات صفحة الويب سوف تكون باللغة العربية، وذلك لأننا إخترنا القيمة ar أما إذا كان المحتوى باللغة الإنجليزية فيمكن أن تكون قيمة الوصف en. وقمنا بوضع وسم البداية (Opening Tag) في أول الأكواد وفي نهاية الكود كتبنا وسم النهاية (Closing Tag)، وبعد ذلك سوف نقسم الصفحة إلى قسمين رئيسيين أولهما  ومحتوى هذا الوسم لا يظهر في المتصفح، ولكنه يحتوي على معلومات عن الصفحة وعن كيفية عرض محتويات الصفحة وذلك بإستخدام العناصر وثاني قسم في صفحة الويب وكل ما يكتب بداخل هذا الوسم هو ما يتم عرضه وتنسيقه من خلال المتصفح\n\nما هي لغة ترميز النص الفائق؟\nلغة ترميز النص الفائق هي ليست لغة برمجيّة بل لغة وصفيّة (markup language) تعمل على وصف هيكلة محتويات صفحات الويب. تتألف لغة ترميز النص الفائق من مجموعة من العناصر (elements) تُستخدَم لاحتواء الأجزاء المختلفة من المحتوى لتجعله يظهر بطريقة معينة. فيمكن استخدام الوسوم المغلقة (enclosing tage)، مثلاً، لإضافة رابط تشعبي لكلمة أو لصورة يشير لموقع آخر، كما يمكن استخدامها لجعل الكلام مائل أو لتصغير الخط وتكبيره. لنأخذ  النص التالي كمثال:\nماذا ستتعلم في كورس تصميم مواقع الويب و كورس html\nمقدمة عن تصميم المواقع الالكترونية وأنواع المواقع وطرق تصميم المواقع\nالتعريف ببرامج تصميم المواقع المختلفة و مميزات كل منها\n التعريف بلغة HTML المستخدمة في تصميم المواقع \nشرحة بنية ومحتويات ملف HTML\nشرح tags and containers\nشرح انواع content models in HTML5\nأساسيات HTML\nشرح المسافات الفارغة والتعليفات في الكود\nالنصوص والفقرات\nتنسيق الملف\nاضافة صور الى موقعك\nاضافة فيديوهات الى موقعك\nاضافة صوتيات الى موقعك\nاستخدام block and inline tags\nDisplaying characters with references\nMetadata and the Document Head\nاضافة الاسكربتات للملف\nاستخدام الميتا تاج Meta Tag\nطريقة تهيئة الصفحة لمحركات البحث\nالنصوص\nHTML5\nاستخدام الجداول Tables\nشرح وأستخدام أجزاء الجداول\nGrouping columns\nالقوائم في لغة html\nاضافة نوافذ مواقع اخرى الى موقعك\nاضافة فيديوهات يوتيوب الى موقعك\nالتعامل مع ال input بمختلف اشكالها"},"lengthSeconds":"5964","ownerProfileUrl":"http://www.youtube.com/@AbdelrahmanGamal","externalChannelId":"UCbQh1yxBPVhyjB-G_blFFEQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE", t":{"simpleText":"...afficher plus"},"showLessText":{"simpleText":"Moins"},"trackingParams":"CIQDEM2rARgBIhMI6fLVqo-HjQMVx0VPBB0p7SVH","defaultExpanded":false,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"CIQDEM2rARgBIhMI6fLVqo-HjQMVx0VPBB0p7SVH","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CIQDEM2rARgBIhMI6fLVqo-HjQMVx0VPBB0p7SVH","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CIQDEM2rARgBIhMI6fLVqo-HjQMVx0VPBB0p7SVH","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CIQDEM2rARgBIhMI6fLVqo-HjQMVx0VPBB0p7SVH","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"ماذا تعني لغة الترميز HTML؟ ما هي أنواع الوسوم - Tags أو عناصر HTML؟ وما هي المكونات الأساسية لعناصر HTML؟ وشرح باللغة العربية خطوة بخطوة لـ تعلم لغه html، كيفية إنشاء صفحة ويب بإستخدام أكواد HTML\n\n\n________________\n\nعملت تحدي html جميل جداً تقدروا تختبروا مستواكم فيه\nالتحدي مكون من 35 سؤال هنا\n\nhttps://nouvil.net/problem-solving/ht...\n\n\n\n\n\nالجروب الخاص بنا\n  / 1810581845642171  \n\nتحميل محرر الاكواد visual  studio لاجهزة الكومبيوتر\nhttps://code.visualstudio.com/\n\nتحميل تطبيق محرر الاكواد للهواتف الاندرويد\nhttps://play.google.com/store/apps/de...\n\n_______________\nكورس css في فيديو واحد هنا\n   • تعلم css في فيديو واحد فقط | كورس css...  \n\nماهي لغة الترميز HTML؟\nالحروف هي إختصار HyperText Markup Language، وهي ليست لغة برمجية بالمعنى المتعارف عليه للغات البرمجة، ولكنها لغة أو طريقة لوصف محتويات صفحة الويب لبرامج التصفح، حيث أن أي برنامج متصفح انترنت يحتاج لمعرفة محتويات الصفحة من عناوين ونصوص وصور وروابط و غير ذلك من مكونات صفحة الويب، حتى تتمكن من عرضها بالشكل الصحيح، ولغة الترميز HTML، هي اللغة الرئيسية التي يتكون منها أي موقع أو صفحة على شبكة الإنترنت.\n\nوتتكون صفحة الويب من مجموعة من العناصر (Tags) أو تعرف كــ الوسوم، يكتب كل وسم بين (angle brackets) أو كما تسمى علامة أصغر من  وعلامة أكبر  ولا يقوم المتصفح بعرض هذه الوسوم، ولكن يقوم بعرض محتوياتها، وهناك نوعين من الوسوم.\n\nما هي أنواع الوسوم Tags؟\nالنوع الأول: وهو عبارة عن وسم يتم عرض محتواه مباشرة في صفحة الويب، مثال img و input \n\nالنوع الثاgي: وهو عبارة عن وسم يصف ما بداخله من نصوص ، وقد يحتوي هذا الوسم بداخله على وسم آخر كعنصر   وسوف تلاحظ في هذا النوع أن كل وسم يتكون من جزئين (وسم البداية) و (وسم النهاية) وبينهما المحتوى الذي يتم عرضه في المتصفح.\n\nكيفية إنشاء صفحة ويب\nنبدأ أولا بفتح برنامج notepad ثم من خلال القائمة File نقوم بحفظ الملف عن طريق إختيار الأمر Save As، وبعد ذلك سوف تظهر نافذة نكتب في خانة (إسم الملف - File Name) أي إسم من إختيارك فليكن مثلا test.html ويجب كتابة إسم الملف مع إمتداد الملف ولكتابة أكواد HTML يجب أن يكون إمتداد الملف إما (.html أو .htm) و في النافذة من الخانة Save as type سوف نختار All Files وفي خانة (Encoding) سوف نختار UTF-8 وذلك لكي يدعم الملف كتابة اللغة العربية ثم نضغط Save، والشكل التالي يوضح الخطوات بالتفصيل.\nبعد إنشاء الملف ومعرفة المكونات الأساسية لعنصر من عناصر لغة الـ HTML سوف نبدأ بكتابة الأكواد الأساسية لإنشاء صفحة ويب (أو يمكنك نسخ محتويات المربع التالي في الملف) وبعدها سوف أشرح كل عنصر بالتفصيل.\n ووظيفته أن يصف للمتصفح أن الكود المستخدم هو بلغة HTML، أما الوصف lang فوظيفته أن يصف للمتصفح أن محتويات صفحة الويب سوف تكون باللغة العربية، وذلك لأننا إخترنا القيمة ar أما إذا كان المحتوى باللغة الإنجليزية فيمكن أن تكون قيمة الوصف en. وقمنا بوضع وسم البداية (Opening Tag) في أول الأكواد وفي نهاية الكود كتبنا وسم النهاية (Closing Tag)، وبعد ذلك سوف نقسم الصفحة إلى قسمين رئيسيين أولهما  ومحتوى هذا الوسم لا يظهر في المتصفح، ولكنه يحتوي على معلومات عن الصفحة وعن كيفية عرض محتويات الصفحة وذلك بإستخدام العناصر وثاني قسم في صفحة الويب وكل ما يكتب بداخل هذا الوسم هو ما يتم عرضه وتنسيقه من خلال المتصفح\n\nما هي لغة ترميز النص الفائق؟\nلغة ترميز النص الفائق هي ليست لغة برمجيّة بل لغة وصفيّة (markup language) تعمل على وصف هيكلة محتويات صفحات الويب. تتألف لغة ترميز النص الفائق من مجموعة من العناصر (elements) تُستخدَم لاحتواء الأجزاء المختلفة من المحتوى لتجعله يظهر بطريقة معينة. فيمكن استخدام الوسوم المغلقة (enclosing tage)، مثلاً، لإضافة رابط تشعبي لكلمة أو لصورة يشير لموقع آخر، كما يمكن استخدامها لجعل الكلام مائل أو لتصغير الخط وتكبيره. لنأخذ  النص التالي كمثال:\nماذا ستتعلم في كورس تصميم مواقع الويب و كورس html\nمقدمة عن تصميم المواقع الالكترونية وأنواع المواقع وطرق تصميم المواقع\nالتعريف ببرامج تصميم المواقع المختلفة و مميزات كل منها\n التعريف بلغة HTML المستخدمة في تصميم المواقع \nشرحة بنية ومحتويات ملف HTML\nشرح tags and containers\nشرح انواع content models in HTML5\nأساسيات HTML\nشرح المسافات الفارغة والتعليفات في الكود\nالنصوص والفقرات\nتنسيق الملف\nاضافة صور الى موقعك\nاضافة فيديوهات الى موقعك\nاضافة صوتيات الى موقعك\nاستخدام block and inline tags\nDisplaying characters with references\nMetadata and the Document Head\nاضافة الاسكربتات للملف\nاستخدام الميتا تاج Meta Tag\nطريقة تهيئة الصفحة لمحركات البحث\nالنصوص\nHTML5\nاستخدام الجداول Tables\nشرح وأستخدام أجزاء الجداول\nGrouping columns\nالقوائم في لغة html\nاضافة نوافذ مواقع اخرى الى موقعك\nاضافة فيديوهات يوتيوب الى موقعك\nالتعامل مع ال input بمختلف اشكالها","commandRuns":[{"startIndex":297,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CIQDEM2rARgBIhMI6fLVqo-HjQMVx0VPBB0p7SVHSMyU19u-tKG-qwE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbFZpaGNLTzBWenBhQVEzR1I3czBUajF5TVQ2QXxBQ3Jtc0trWWxZZ0syaXFZY3FmTElXMEMxZWhfR24tREJUVzB2YUFvQ2g1WF9SOEc4YVVONDhiVlVfTnlmQ0pyNDdXNE5PSDUyWVNFQ1N6Yk1lZWtHbXZtMk5GcVI3SjVDZ3NuSnlPVzhJbzMxQkFRcGNvSU9qNA\u0026q=https%3A%2F%2Fnouvil.net%2Fproblem-solving%2Fhtml-quiz%2F\u0026v=q3yFo-t1ykw","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbFZpaGNLTzBWenB kTrackingParams":"CBgQ040EGAYiEwjp8tWqj4eNAxXHRU8EHSntJUc=","commandMetadata":{"webCommandMetadata":{"url":"/@AbdelrahmanGamal","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCbQh1yxBPVhyjB-G_blFFEQ","canonicalBaseUrl":"/@AbdelrahmanGamal"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/ytc/AIdro_l5AYO9yPcxvzu3zybDvEIRc2n39ZqEfvz0eS_II0iPPVo=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Plus"}},"simpleText":"...afficher plus"},"showLessText":{"simpleText":"Moins"},"attributedDescriptionBodyText":{"content":"ماذا تعني لغة الترميز HTML؟ ما هي أنواع الوسوم - Tags أو عناصر HTML؟ وما هي المكونات الأساسية لعناصر HTML؟ وشرح باللغة العربية خطوة بخطوة لـ تعلم لغه html، كيفية إنشاء صفحة ويب بإستخدام أكواد HTML\n\n\n________________\n\nعملت تحدي html جميل جداً تقدروا تختبروا مستواكم فيه\nالتحدي مكون من 35 سؤال هنا\n\nhttps://nouvil.net/problem-solving/ht...\n\n\n\n\n\nالجروب الخاص بنا\n  / 1810581845642171  \n\nتحميل محرر الاكواد visual  studio لاجهزة الكومبيوتر\nhttps://code.visualstudio.com/\n\nتحميل تطبيق محرر الاكواد للهواتف الاندرويد\nhttps://play.google.com/store/apps/de...\n\n_______________\nكورس css في فيديو واحد هنا\n   • تعلم css في فيديو واحد فقط | كورس css...  \n\nماهي لغة الترميز HTML؟\nالحروف هي إختصار HyperText Markup Language، وهي ليست لغة برمجية بالمعنى المتعارف عليه للغات البرمجة، ولكنها لغة أو طريقة لوصف محتويات صفحة الويب لبرامج التصفح، حيث أن أي برنامج متصفح انترنت يحتاج لمعرفة محتويات الصفحة من عناوين ونصوص وصور وروابط و غير ذلك من مكونات صفحة الويب، حتى تتمكن من عرضها بالشكل الصحيح، ولغة الترميز HTML، هي اللغة الرئيسية التي يتكون منها أي موقع أو صفحة على شبكة الإنترنت.\n\nوتتكون صفحة الويب من مجموعة من العناصر (Tags) أو تعرف كــ الوسوم، يكتب كل وسم بين (angle brackets) أو كما تسمى علامة أصغر من  وعلامة أكبر  ولا يقوم المتصفح بعرض هذه الوسوم، ولكن يقوم بعرض محتوياتها، وهناك نوعين من الوسوم.\n\nما هي أنواع الوسوم Tags؟\nالنوع الأول: وهو عبارة عن وسم يتم عرض محتواه مباشرة في صفحة الويب، مثال img و input \n\nالنوع الثاgي: وهو عبارة عن وسم يصف ما بداخله من نصوص ، وقد يحتوي هذا الوسم بداخله على وسم آخر كعنصر   وسوف تلاحظ في هذا النوع أن كل وسم يتكون من جزئين (وسم البداية) و (وسم النهاية) وبينهما المحتوى الذي يتم عرضه في المتصفح.\n\nكيفية إنشاء صفحة ويب\nنبدأ أولا بفتح برنامج notepad ثم من خلال القائمة File نقوم بحفظ الملف عن طريق إختيار الأمر Save As، وبعد ذلك سوف تظهر نافذة نكتب في خانة (إسم الملف - File Name) أي إسم من إختيارك فليكن مثلا test.html ويجب كتابة إسم الملف مع إمتداد الملف ولكتابة أكواد HTML يجب أن يكون إمتداد الملف إما (.html أو .htm) و في النافذة من الخانة Save as type سوف نختار All Files وفي خانة (Encoding) سوف نختار UTF-8 وذلك لكي يدعم الملف كتابة اللغة العربية ثم نضغط Save، والشكل التالي يوضح الخطوات بالتفصيل.\nبعد إنشاء الملف ومعرفة المكونات الأساسية لعنصر من عناصر لغة الـ HTML سوف نبدأ بكتابة الأكواد الأساسية لإنشاء صفحة ويب (أو يمكنك نسخ محتويات المربع التالي في الملف) وبعدها سوف أشرح كل عنصر بالتفصيل.\n ووظيفته أن يصف للمتصفح أن الكود المستخدم هو بلغة HTML، أما الوصف lang فوظيفته أن يصف للمتصفح أن محتويات صفحة الويب سوف تكون باللغة العربية، وذلك لأننا إخترنا القيمة ar أما إذا كان المحتوى باللغة الإنجليزية فيمكن أن تكون قيمة الوصف en. وقمنا بوضع وسم البداية (Opening Tag) في أول الأكواد وفي نهاية الكود كتبنا وسم النهاية (Closing Tag)، وبعد ذلك سوف نقسم الصفحة إلى قسمين رئيسيين أولهما  ومحتوى هذا الوسم لا يظهر في المتصفح، ولكنه يحتوي على معلومات عن الصفحة وعن كيفية عرض محتويات الصفحة وذلك بإستخدام العناصر وثاني قسم في صفحة الويب وكل ما يكتب بداخل هذا الوسم هو ما يتم عرضه وتنسيقه من خلال المتصفح\n\nما هي لغة ترميز النص الفائق؟\nلغة ترميز النص الفائق هي ليست لغة برمجيّة بل لغة وصفيّة (markup language) تعمل على وصف هيكلة محتويات صفحات الويب. تتألف لغة ترميز النص الفائق من مجموعة من العناصر (elements) تُستخدَم لاحتواء الأجزاء المختلفة من المحتوى لتجعله يظهر بطريقة معينة. فيمكن استخدام الوسوم المغلقة (enclosing tage)، مثلاً، لإضاف
